INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 24001, 40011, 321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 1, 0, "リリ", 125801, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 24001, 40011, 322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 2, 0, "クリア", 126001, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 24001, 40011, 323, "んーと。\nこれ、あげる。\nはい", 1, 3, 0, "プレシア", 126101, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 24001, 40011, 324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 4, 0, "リリ", 125801, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 24001, 40011, 325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 5, 0, "クリア", 126001, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 24001, 40011, 326, "お兄。\nきてくれて、うれしい", 2, 6, 0, "プレシア", 126101, 1);
